import { useState } from "react";
import { data } from "./data";
import {useForm} from "react-hook-form"

function App() {
  const{register,handleSubmit,formState:{errors},getValues}=useForm();
  const[data,setData]=useState({})
  const hh=(data)=>{
    setData(data)
  }
  return (
    <>
    <form action="" onSubmit={handleSubmit(hh)} className="flex flex-col">
      <input className="border-[1px] border-black" type="text" {...register("name",{required:true})} />
      {errors.name && <span className="text-red-500 ">Field Rquired</span>}
      <input {...register("email")} />
      <input type="submit" value="Submit" />
      <h3>{data}</h3>
    </form>
    </>
  );
}

export default App;
